#!/bin/bash

# Exit on error
set -e

if [ $# -ne 1 ]
then
    echo ""
    echo "Usage: $0 <number of bits in the lookup vector>"
    echo ""
    exit 1
fi

numDVs=8
echo $numDVs > $1

i=0

# Create as many cache entries
while [ $i -lt $numDVs ]
do
    maxRange=$(bc <<< "(($1 + 9) / 10)")
    minRange=$(bc <<< "(($1 + 9) / 20) + 1")
    # Generate a random number for the number of position/value pairs. The "+9" = ceiling function
    posValuePairNum=`shuf -i $minRange-$maxRange -n 1`
    echo $posValuePairNum >> $1

    # Generate as many lines, where each line contains the (position value) tuple
    j=0
    while [ $j -lt $posValuePairNum ]
    do
        # Generate a random position value that fits into the index
        position=$(bc <<< "$RANDOM % $1")

        # Generate a random value (can be only 0 or 1)
        value=$(bc <<< "$RANDOM % 2")

        echo "$position $value" >> $1

        j=$(bc <<< "$j + 1")
    done

    i=$(bc <<< "$i + 1")
done
echo "" >> $1
